It's been such a pleasure to be able to #Sharethemic with Victoria. I can't thank her enough for opening up her platform to help magnify Black women's voices for #BlackHistoryMonth UK. Victoria truly embodies the Power of Women, for over two decades she has been a glass ceiling smasher, rule breaker and trailblazer showing us all what it means to live your dreams in technicolour reality. As a wife, mother and entrepreneur she is the definition of #GirlPower

